import React from 'react'
import Navbar from './Navbar'
import { ReactTyped } from "react-typed";

function Conference() {
  return (
    
    <div>

        <Navbar/>
        <ReactTyped
      strings={[
        "STAY TUNED"
        
      ]}
      typeSpeed={40}
      backSpeed={50}
      attr="placeholder"
      loop
    >
      
    </ReactTyped>
        
    </div>
  )
}

export default Conference
